import React from "react";

const Header = () =>{

    return(

        <>

            <div className="container-fluid">
            <div className="header">
              <div className="content_box">
                  <div className="container-lg m-auto">
                    <h1>Google Keep</h1>
                  </div>
              </div>  
            </div>
            </div>
            


        </>
    );
}
export default Header;
